import "../components/styles/Header.css"

export default function Header() {
    return (
        <nav>
            <div>
                <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fpixabay.com%2Fimages%2Fsearch%2Fnature%2F&psig=AOvVaw2n1EGGtgtcUf66J7l9iacq&ust=1671420476874000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCOCg3dacgvwCFQAAAAAdAAAAABAD" alt="Rehoboth Evangelical Ethiopian Church logo"/>
                <h2>Rehoboth</h2>
                <p>Ethiopian Church</p>
            </div>
        </nav>
    )
}
